import logo from './logo2.svg';
import './App.css';
const openmoji = require('openmoji');

function importAll(r) {
  let images = {};
  r.keys().map((item, index) => { images[item.replace('./', '')] = r(item); });
  return images;
}
const images = importAll(require.context('./openmoji-svg-color', false, /\.(png|jpe?g|svg)$/));

const om = openmoji.openmojis[0];

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={images[om.hexcode + '.svg']} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
          Bet this looks pretty cool huh? om.hexcode 
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
